'use client';
import { jsx } from 'react/jsx-runtime';
import { List } from '../List/index.js';
import { Link } from '../Link/Link.js';

const ErrorSummaryItem = ({ href, asChild, children, ...rest }) => {
    return (jsx(List.Item, { ...rest, children: jsx(Link, { href: href, asChild: asChild, children: children }) }));
};
ErrorSummaryItem.displayName = 'ErrorSummaryItem';

export { ErrorSummaryItem };
